---
apiVersion: networking.k8s.io/v1
kind: Ingress
metadata: 
  name: freshrss
  annotations:
    cert-manager.io/cluster-issuer: letsencrypt-production
    kavorites.koudijs.app/title: FreshRSS
    #kavorites.koudijs.app/image-url: https://avatars.githubusercontent.com/u/9414285
    kavorites.koudijs.app/image-b64: ""
spec:
  rules:
    - host: rss.koudijs.me
      http:
        paths:
          - path: /
            pathType: Prefix
            backend:
              service:
                name:  freshrss
                port:
                  number: 80
  tls:
    - secretName: freshrss-cert
      hosts:
        - rss.koudijs.me
